    mdx( 'p', null, mdx( 'em', { parentName: "p" }, `Updated October 28, 2024`) ),
    mdx( 'p', null, `The Apartment List Research Team aims to make accurate, timely, and transparent housing market data available to the general public. On this page you will find our current data offerings, updated monthly.` ),
    mdx( 'p', null, mdx( 'strong', { parentName: "p" }, mdx( 'em', { parentName: "strong" }, `Note: In August 2023, we updated the methodology for our vacancy index. If you are working with data dowloaded prior to that date, please use the current series (available below) to access the most recent revisions. The methodology for our rent estimates was not changed.`)) ),
